import { Input } from "antd";
import { Form } from "react-router-dom";

const ListAdd = () => {
  return (
    <>
      <Form>
        <Form.Item
          name="name"
          rules={[{ required: true, message: "List nomini kiriting!" }]}
        >
          <Input placeholder="List nomini yozin" />
        </Form.Item>
      </Form>
    </>
  );
};

export default ListAdd;
